description:
Contains 2 studio albums by the an obscure 80's band called DB Cooper after the infamous fugitive. Something like a mix of heartland rock/new wave/power pop.

The Band:  Jon Chapman - Drums and backup vocals / Roger Heath - Guitar and backup vocals /Robby Scharf - Bass and backup vocals / Ric Streeter - Guitar and backup vocals / D B Cooper - vocals

Buy American (1980) Third party rip from vinyl, LAME 3.92 + last track FhG for some reason (but can't be picky with rare albums like these), average bitrate 313kbps.

Dangerous Curves (1981) Third party rip from vinyl, LAME 3.97, average bitrate 312kbps.


